export default class Fetch extends Component {
  constructor() {
    super();

    this.state = {players: []};
}
  componentDidMount() {
    fetch('/players/1')
      .then(response => response.json())
      .then(data =>{
          this.setState({players:data.results});
      })
  }
  render() {
    return (
      <div>

      </div>
    )
  }
}
